import React, { useState } from "react";
import getBreeds from "../helpers/getBreeds";

const initialBreeds = [
	{
		id: 1,
		name: "Boxer",
	},
	{
		id: 2,
		name: "Husky",
	},
	{
		id: 3,
		name: "Pintscher",
	},
];

const Select = () => {

    const [breeds, setBreeds] = useState(initialBreeds);

    useEffect(() => {
        updateBreeds
    }, []);

    const updateBreeds = () => {
        getBreeds()
        .then((newBreeds) => {
            setBreeds(newBreeds)
        })
    }

	return (
        <select>
			{breeds.map(breed => (
                <option value={breed.id} key={breed.id}>{breed.name}</option>
            ))}
		</select>
	);
};

export default Select;
